import Post from '../post/Post'
import './posts.css'
import {Link} from 'react-router-dom'

export default function Posts({posts}) {
  return (
    <Link as='link' to='/post/postId'>
  <div className='posts'>
    {posts.map(p =>(
      <Post post={p}/>
    ))}
      
      
      
    </div>
    </Link>
  )
}
